import React, { useEffect, useState } from 'react';
import Sidebar from './Sidebar';
import { Box, Typography, Grid, Paper, List, ListItem, ListItemText, Button } from '@mui/material';

const Dashboard = () => {
  const [learningGoals, setLearningGoals] = useState([]);
  const [tutoringHistory, setTutoringHistory] = useState([]);
  const [upcomingSessions, setUpcomingSessions] = useState([]);
  const [resources, setResources] = useState([]);

  // Mock data to simulate API responses
  useEffect(() => {
    // Fetch or set mock data for personalized learning goals
    setLearningGoals([
      { id: 1, goal: 'Improve math skills by 20%' },
      { id: 2, goal: 'Read 5 new books on science' },
    ]);

    // Fetch or set mock data for tutoring history
    setTutoringHistory([
      { id: 1, date: '2024-09-01', topic: 'Algebra Basics', feedback: 'Good progress!' },
      { id: 2, date: '2024-09-08', topic: 'Physics: Motion', feedback: 'Needs more practice' },
    ]);

    // Fetch or set mock data for upcoming sessions
    setUpcomingSessions([
      { id: 1, date: '2024-09-15', time: '10:00 AM', subject: 'Chemistry' },
      { id: 2, date: '2024-09-17', time: '11:30 AM', subject: 'Math' },
    ]);

    // Fetch or set mock data for resources and study materials
    setResources([
      { id: 1, title: 'Algebra Study Guide', link: '/resources/algebra' },
      { id: 2, title: 'Physics Motion Notes', link: '/resources/physics-motion' },
    ]);
  }, []);

  return (
    <Box sx={{ display: 'flex', minHeight: '100vh', backgroundColor: '#1e1e1e' }}>
      <Sidebar />
      <Box component="main" sx={{ flexGrow: 1, p: 3, backgroundColor: '#2c2c2c', color: '#fff' }}>
        <Typography variant="h4" gutterBottom>
          Hello, [Student Name]!
        </Typography>

        {/* Section: Personalized Learning Goals */}
        <Paper sx={paperStyle}>
          <Typography variant="h6">Personalized Learning Goals</Typography>
          <List>
            {learningGoals.map((goal) => (
              <ListItem key={goal.id}>
                <ListItemText primary={goal.goal} />
                <Button variant="outlined" color="secondary">Update</Button>
              </ListItem>
            ))}
          </List>
        </Paper>

        {/* Section: Tutoring History */}
        <Paper sx={paperStyle}>
          <Typography variant="h6">Tutoring History</Typography>
          <List>
            {tutoringHistory.map((session) => (
              <ListItem key={session.id}>
                <ListItemText
                  primary={`${session.date} - ${session.topic}`}
                  secondary={`Feedback: ${session.feedback}`}
                />
              </ListItem>
            ))}
          </List>
        </Paper>

        {/* Section: Upcoming Sessions and Reminders */}
        <Paper sx={paperStyle}>
          <Typography variant="h6">Upcoming Sessions and Reminders</Typography>
          <List>
            {upcomingSessions.map((session) => (
              <ListItem key={session.id}>
                <ListItemText
                  primary={`${session.date} at ${session.time}`}
                  secondary={`Subject: ${session.subject}`}
                />
                <Button variant="outlined" color="secondary">Set Reminder</Button>
              </ListItem>
            ))}
          </List>
        </Paper>

        {/* Section: Resources and Study Materials */}
        <Paper sx={paperStyle}>
          <Typography variant="h6">Resources and Study Materials</Typography>
          <List>
            {resources.map((resource) => (
              <ListItem key={resource.id}>
                <ListItemText primary={resource.title} />
                <Button variant="outlined" color="secondary" href={resource.link}>View</Button>
              </ListItem>
            ))}
          </List>
        </Paper>
      </Box>
    </Box>
  );
};

const paperStyle = {
  padding: '20px',
  marginBottom: '20px',
  backgroundColor: '#333',
  color: '#fff',
  borderRadius: '8px',
  boxShadow: '0 4px 8px rgba(0, 0, 0, 0.2)',
};

export default Dashboard;
